<div class="iteminfo_area">
<div class="iteminfo_title">
<p>商品説明</p>
</div>
<div>
<p><p style="margin:0;"><strong>タイガー ステンレスランチジャー　おすすめポイント</strong><br>
1）まほうびん構造で、いつでもあったかお弁当を実現<br>
真空二重構造の保温容器で、温かいお弁当をそのまま長時間キープ。温かい味噌汁やスープも楽しめます。<br>
<br>
2）汚れやニオイがつきにくい「スーパークリーン」加工<br>
カップの内面には、なめらかで光沢のあるスーパークリーン加工。汚れや匂いもつきにくい。<br>
<br>
3）便利な付属品で、使いやすさアップ<br>
手の大きな男性にも使いやすい約20cmの「専用はし」、持ち運びらくらくの太めのショルダーベルトで持ち運びもラクラク。</p></p>
</div>
</div>

