ENJO (エンヨー）は欧州オーストリア発の世界ブランド。洗剤を使用しないお掃除道具として世界26ヶ国の人々に愛用されています。<br>
●ENJOの特殊ファイバーは、1056本の極細繊維が集まって1本になっており、形は特殊なシャープエッジ状で、吸水力や細かな部分の除去力に優れ、取り込まれた汚れは再付着することなく洗った時に落ちる仕組みです。<br>
●洗剤不要！超吸収性。拭きあとを残さずピカピカに仕上がるアウトドア用お掃除クロス！ ※汚れを落とす場合には、水で濡らして固く絞ると更に効果を発揮。<br>
●マイクロファイバーからできているため、吸水性に優れ、軽い汚れも水だけで落とします。拭き跡やムラを残さないので、洗車後などの仕上げとして拭くと、表面が非常にきれいに仕上がります。<br>
●水拭き・乾拭きどちらでも使用可。汚れを落とす場合には、水で濡らして固く絞ると更に効果を発揮。<br>
●屋外の硬い表面のお手入れに便利！（自動車の塗装面、鏡、フロントガラス、バイク、自転車、窓枠、ゴルフクラブ、ボールなど）<br>
