<br>

＜用途＞<br>
日常生活におけるスクリーン画面のお手入れに。<br>
テレビ、パソコン、携帯電話(スマートフォン)、鏡、メガネ、カメラ、液晶ディスプレイ等<br>
※ファンデーション等が付着した鏡にもご使用頂けます。<br><br>

＜ご使用方法＞<br>
水拭きまたは乾拭き。<br>
引っかき傷（摩擦による傷）がつくのを避けるために、お掃除する前に表面の頑固なほこりや汚れをあらかじめ取り除くか、表面をはたいて下さい。<br><br>

＜特徴＞<br>
ENJOファイバーの秘密である細かく枝分かれした極細繊維とファイバー両面の追加の毛羽立ち加工によって、他に類のない驚くべき吸収力を発揮します。<br>
化学薬品を一切使わず、液晶や鏡等を綺麗にお掃除することが出来ます。<br><br>

＜ご注意＞<br>
40度以上のお湯で洗わないで下さい。<br>
色落ちすることがあるため、同系色のものと一緒に洗濯して下さい。<br>
鋭く尖ったものは、きめ細かいクロスを痛める恐れがありますが、それによってクロスのお掃除の性能が落ちることはありません。<style type="text/css">
